import React, { Component } from 'react';
import Navbar from '../components/Navbar';

export class Admin extends Component {
	render() {
		return(
			<React.Fragment>
				<Navbar/>
				<div>Admin</div>
			</React.Fragment>

			);
	}
}

export default Admin;
